import React from "react";
import { Container, Input, Left, Right } from "./contextNav";
import { RiYoutubeFill } from "react-icons/ri";

const ContextNavbar = () => {
  return (
    <Container>
      <Left>
        <RiYoutubeFill />
        <h2>YouTube</h2>
      </Left>
      <Right>
        <Input type="text" />
        <h4>Home</h4>
        <h3>Count :</h3>
      </Right>
    </Container>
  );
};

export default ContextNavbar;
